import React from 'react';

export class App extends React.Component {
  state = {
    name: 'Tudor',
    age: 30
  }
  render() {
    return (
      <div className="App" >
        <h1>Hello {this.state.name}</h1>
        <p>You must be {this.state.age}</p>
      </div >
    );
  }
}
export default App
